    "2016-07-27T23:06:36.304788",nt"name": "water-quality-monitoring",nt"isopen":
    false,nt"url": null,nt"notes": "Our water quality sampling program is to
    determine the quality of Moosehorn's lakes and a limited number of streams. Water
    quality is a measure of the body of water, such as a river or stream, to support
    a variety of aquatic life; the greater the variety, the higher the quality. We tested
    the water for acidity, alkalinity, CO2, hardness, dissolved oxygen, and visibility
    factors. Climate, geology and biological processes are beyond human control. Fortunately
    these natural factors rarely cause water quality problems. Our objective was to
    collect samples to determine the water quality here at Moosehorn is being maintained
    and provide data that can be used in the future to compare with that quality. By
    monitoring water quality here we can identify land-use problems and water discharge
    violations.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
